--
-- Name: metafull; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.metafull AS
 SELECT metadato.idmetadato,
    metadato.titulo,
    metadato.pclave,
    to_char((metadato.creado)::timestamp with time zone, 'DD/MM/YYYY'::text) AS creado,
    to_char((metadato.disponibilidad)::timestamp with time zone, 'DD/MM/YYYY'::text) AS disponibilidad,
    metadato.resumen,
    metadato.descripcion,
    metadato.tipo,
    metadato.lote,
    metadato.fase,
    metadato.publico,
    metadato.formato,
    metadato.tamano,
    metadato.url,
    subcategoria.subcategoria,
    categoria.categoria,
    finca.finca,
    finca.cultivo,
    municipio.municipio,
    departamento.departamento
   FROM (((((((public.metadato
     JOIN public.metadato_has_subcategoria ON ((metadato.idmetadato = metadato_has_subcategoria.metadato_idmetadato)))
     JOIN public.metadatos_has_finca ON ((metadato.idmetadato = metadatos_has_finca.metadato_idmetadato)))
     JOIN public.subcategoria ON ((metadato_has_subcategoria.subcategoria_idsubcategoria = subcategoria.idsubcategoria)))
     JOIN public.finca ON ((metadatos_has_finca.finca_idfinca = finca.idfinca)))
     JOIN public.categoria ON ((categoria.idcategoria = subcategoria.categoria_idcategoria)))
     JOIN public.municipio ON ((municipio.idmunicipio = finca.municipio_idmunicipio)))
     JOIN public.departamento ON ((departamento.iddepartamento = municipio.departamento_iddepartamento)));


ALTER TABLE public.metafull OWNER TO postgres;

